<!DOCTYPE html>
<!--https://sapui5.hana.ondemand.com/versionoverview.html			-->

<html>
	<head>
		<meta charset="utf-8">
		<title>SAPUI Walkthrough Demo</title>
		<script
			id="sap-ui-bootstrap"
			src="https://sapui5.hana.ondemand.com/1.71.16/resources/sap-ui-core.js"
			data-sap-ui-async="true"
			data-sap-ui-theme="sap_belize"
			data-sap-ui-compatVersion="edge"
			data-sap-ui-resourceRoots='{"sap.ui.demo.walkthrough":"./"}'
			data-sap-ui-onInit="module:sap/ui/core/ComponentSupport"
		>
			
		</script>
	</head>
	<body style="sapUiBody" id="content">
		<div
			data-sap-ui-component
			data-name="sap.ui.demo.walkthrough"
			data-id="container"
			
			data-settings='{
				"id":"walkthrough"
			}'
		>
			
		</div>
		
	</body>
	
</html>
